import React from 'react';
import logo from '../images/logo.png'

function Home() {
  return (
    <div className="hmain">
        <marque>Welcome To Unimart Overseas A Immigration Company</marque>
      <img src={logo} alt="Homelogo" />
    </div>
  );
}

export default Home;
